def findall_middle_brackets(string, leftright='[]', force=True):
    left, right = leftright
    s = string
    p = {}
    l, r = 0, 0
    q = s.find(left)
    while True:
        c = []
        if q == -1: break
        for idx,i in enumerate(s[q:]):
            if i == left:  c.append(left)
            if i == right: c.pop()
            if len(c) == 0:
                l, r = q, q + idx + 1
                p[(l, r)] = s[l:r]
                q = s.find(left, r)
                break
        if len(c) > 0:
            if force: return p
            raise KeyError('unparse in index:{}'.format(l))
    return p

